import React from 'react';
import Huge from '../components/Huge';
import Content from '../components/Content';
import Container from 'react-bootstrap/Container'; 
import Row from 'react-bootstrap/Row'; 
import Col from 'react-bootstrap/Col';
function SkillsSection(props) {
	return(
		<div id="skills" className="homelayout">
			<Huge  subTitle={props.subTitle} />
			<Container fluid= {true}>
							
				<Row className = "text-justify ml-2">
					<Col md = {7} sm={7} className = "edu_col">
							<p className = "edu ml-4 mt-5  intro  font-weight-LIGHT"><small><i>Languages</i></small></p>
							<ul className="ml-2 exp_list  ">
							<li className="skill_list ml-5 mt-0 font-weight-LIGHT"><small>Python</small> </li>
							
							</ul>
							<p className = "edu_sub ml-4 intro font-weight-LIGHT"><small>Python</small></p> 
					</Col>
				
				</Row>
			</Container>
		</div>
	
	);
}

export default SkillsSection;
